			shellScript = "# === Script pour copier la librairie ExifTool en prservant la structure ===\n\n# Chemin vers le dossier Image-ExifTool DANS VOTRE PROJET Xcode\n# !!! IMPORTANT : VRIFIEZ ET AJUSTEZ CE CHEMIN SI NCESSAIRE !!!\n# Il doit correspondre  l'emplacement o vous avez gliss le dossier bleu Image-ExifTool\n# (Ici, je suppose qu'il est dans un groupe \"ExifTool Resources\"  la racine du projet PhotoMetaFixer)\nSOURCE_DIR=\"${SRCROOT}/PhotoMetaFixer/Ressources/Image-ExifTool\"\n\n# Chemin de destination DANS L'APPLICATION FINALE (.app)\n# On cre un sous-dossier Image-ExifTool dans Resources\nDEST_DIR=\"${BUILT_PRODUCTS_DIR}/${FULL_PRODUCT_NAME}/Contents/Resources/Image-ExifTool\"\n\n# Vrifier si le dossier source existe\nif [ ! -d \"${SOURCE_DIR}\" ]; then\n  echo \"Erreur: Le dossier source d'ExifTool n'existe pas  ${SOURCE_DIR}\"\n  exit 1\nfi\n\necho \"Nettoyage de la destination prcdente (si existe)...\"\nrm -rf \"${DEST_DIR}\"\n\necho \"Cration du dossier de destination...\"\nmkdir -p \"${DEST_DIR}\"\n\necho \"Copie de la librairie ExifTool depuis ${SOURCE_DIR} vers ${DEST_DIR}...\"\n# Utiliser rsync pour copier rcursivement en prservant les attributs\nrsync -a \"${SOURCE_DIR}/\" \"${DEST_DIR}/\"\n\nif [ $? -eq 0 ]; then\n  echo \"Copie de la librairie ExifTool termine avec succs.\"\nelse\n  echo \"Erreur: La copie de la librairie ExifTool a chou.\"\n  exit 1\nfi\n\nexit 0\n";
